import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="bg-clippersBlue text-clippersWhite w-64 h-screen p-4 flex flex-col items-center fixed top-0 left-0">
    {/* Logo */}
    <img
      src="https://cdn.nba.com/logos/nba/1610612746/primary/L/logo.svg"
      alt="LA Clippers Logo"
      className="w-24 h-auto mb-8"
    />
    {/* Navigation Links */}
    <div className="space-y-4 text-center">
      <Link to="/" className="block hover:underline">Home</Link>
      <Link to="/team" className="block hover:underline">Team</Link>
      <Link to="/league" className="block hover:underline">League</Link>
    </div>
  </nav>
);

export default Navbar;
